import logo from './logo.svg';
import './App.css';
import { useState } from 'react';

function App() {

  const [search, setSearch] = useState('');
  const click = () => {
    alert(search)
  }
  const change = event => {
    setSearch(event.target.value)
  }


  return (
    <div className="App">
      <input onChange={change} value={search}/>
      <button onClick={click}>Search</button>
    </div>
  );
}

export default App;
